import { Button, Pressable, SafeAreaView, StatusBar, StyleSheet, Text, View } from 'react-native';

export function HomeUI({ navigation }) {

    const ui = (

        <SafeAreaView style={styles.main}>
            <Button title='Create New Note' onPress={goToCreate} />
            <Button title='Sign In' onPress={goToSignIn} />
            <Button title='Sign Up' onPress={goToSignUp} />



        </SafeAreaView>
    );


    function goToCreate() {
        navigation.navigate("Create New Note");
    }

    function goToSignIn() {
        navigation.navigate("Sign In");
    }

    function goToSignUp() {
        navigation.navigate("Sign Up");
    }

    return ui;


}

const styles = StyleSheet.create({
    main: {
        flex: 1,
    },

    view1: {
        flex: 1,
        backgroundColor: "red",
    },

    view2: {
        flex: 1,
        backgroundColor: "yellow",
    },

    view3: {
        flex: 6,
        backgroundColor: "blue",
    },

    text1: {
        fontSize: 50,
        color: "white",
    },

    btn: {
        flex: 2,
        backgroundColor: "red"
    }
});
